import logo from '../imgs/Mines_Paris_logo.jpg'
import "./Header.css"

interface Props {
    title: String
    description : String
}

function Header(props : Props) {
    const {title, description} = props
    return (
        <div className='Header'>
            <h1>{title} </h1>
            <p> 
                <em>{description}</em>
            </p>
            <img 
                alt="Mines Paris logo"
                src={logo}   
                height={150}
            />
        </div>
    )
}

export default Header
